INSERT INTO `vina_content` VALUES ('1', '36', 'Buttons', 'buttons', '<div class=\"btn-group\">\r\n  <button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-default\">Left</button>\r\n  <button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-default\">Middle</button>\r\n  <button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-default\">Right</button>\r\n</div>\r\n&nbsp;\r\n\r\n<div id=\"accordion2\" class=\"accordion\">\r\n<div class=\"accordion-group\">\r\n<div class=\"accordion-heading\"><a class=\"accordion-toggle\" href=\"#collapseTwo\" data-toggle=\"collapse\" data-parent=\"#accordion2\">How to use</a></div>\r\n<div id=\"collapseTwo\" class=\"accordion-body collapse\">\r\n<div class=\"accordion-inner\">\r\n\r\n<pre>\r\n&lt;div class=\"btn-group\"&gt;\r\n  &lt;button type=\"button\" class=\"btn btn-default\"&gt;Left&lt;/button&gt;\r\n  &lt;button type=\"button\" class=\"btn btn-default\"&gt;Middle&lt;/button&gt;\r\n  &lt;button type=\"button\" class=\"btn btn-default\"&gt;Right&lt;/button&gt;\r\n&lt;/div&gt;\r\n</pre>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<br>\r\n\r\n<h3>Standard button</h3>\r\n\r\n<!-- Standard button -->\r\n<button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-default\">Default</button>\r\n\r\n<!-- Provides extra visual weight and identifies the primary action in a set of buttons -->\r\n<button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-primary\">Primary</button>\r\n\r\n<!-- Indicates a successful or positive action -->\r\n<button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-success\">Success</button>\r\n\r\n<!-- Contextual button for informational alert messages -->\r\n<button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-info\">Info</button>\r\n\r\n<!-- Indicates caution should be taken with this action -->\r\n<button style=\"margin-bottom:10px\" type=\"button\" class=\"btn btn-warning\">Warning</button>\r\n\r\n<!-- Indicates a