INSERT INTO `vina_content` VALUES ('2', '37', 'Notifications', 'natifications', '<h3>Success</h3>\r\n<div class=\"alert alert-success\">Well done! You successfully read this important alert message.</div>\r\n\r\n<div id=\"accordion1\" class=\"accordion\">\r\n<div class=\"accordion-group\">\r\n<div class=\"accordion-heading\"><a class=\"accordion-toggle\" href=\"#collapseOne\" data-toggle=\"collapse\" data-parent=\"#accordion1\">How to use</a></div>\r\n<div id=\"collapseOne\" class=\"accordion-body collapse\">\r\n<div class=\"accordion-inner\">\r\n<pre><code>\r\n   &lt;div class=\"alert alert-success\"&gt;Well done! You successfully read this important alert message.&lt;/div&gt;\r\n</code>\r\n</pre>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<br>\r\n\r\n<h3>Info</h3>\r\n<div class=\"alert alert-info\">Heads up! This alert needs your attention, but it\'s not super important.</div>\r\n<div id=\"accordion3\" class=\"accordion\">\r\n<div class=\"accordion-group\">\r\n<div class=\"accordion-heading\"><a class=\"accordion-toggle\" href=\"#collapseThree\" data-toggle=\"collapse\" data-parent=\"#accordion3\">How to use</a></div>\r\n<div id=\"collapseThree\" class=\"accordion-body collapse\">\r\n<div class=\"accordion-inner\">\r\n<pre><code>\r\n  &lt;div class=\"alert alert-info\"&gt;Heads up! This alert needs your attention, but it\'s not super important.&lt;/div&gt;\r\n</code>\r\n</pre>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<br>\r\n<h3>Warning</h3>\r\n<div class=\"alert alert-warning\">Warning! Better check yourself, you\'re not looking too good.</div>\r\n<div id=\"accordion2\" class=\"accordion\">\r\n<div class=\"accordion-group\">\r\n<div class=\"accordion-heading\"><a class=\"accordion-toggle\" href=\"#collapseTwo\" data-toggle=\"collapse\" data-parent=\"#accordion2\">How to use</a></div>\r\n<div id=\"collapseTwo\" class=\"accordion-body collapse\">\r\n<div class=\"accordion-inner\">\r\n<pre><code>\r\n   &lt;div class=\"alert alert-warning\"&gt;Warning! Better c