INSERT INTO `vina_content` VALUES ('6', '41', 'Tooltips ', 'tooltips', '<script type=\'text/javascript\'>\r\n jQuery(document).ready(function(){\r\n   jQuery(\"#top\").tooltip({placement : \'top\'});\r\n   jQuery(\"#right\").tooltip({placement : \'right\'});\r\n   jQuery(\"#bottom\").tooltip({placement : \'bottom\'});\r\n   jQuery(\"#left\").tooltip({ placement : \'left\'});\r\n  });\r\n</script>\r\n<br>\r\n<h3>Tooltip</h3>	\r\n<button style=\"margin-bottom:20px\" type=\"button\" class=\"btn btn-default\" id=\"left\" data-toggle=\"tooltip\" data-placement=\"left\" title=\"Tooltip on left\">Tooltip on left</button>&#xA0; \r\n\r\n<button style=\"margin-bottom:20px\" type=\"button\" class=\"btn btn-default\" id=\"top\" data-toggle=\"tooltip\" data-placement=\"top\" title=\"Tooltip on top\">Tooltip on top</button>&#xA0; \r\n\r\n<button style=\"margin-bottom:20px\" type=\"button\" class=\"btn btn-default\" id=\"bottom\" data-toggle=\"tooltip\" data-placement=\"bottom\" title=\"Tooltip on bottom\">Tooltip on bottom</button> &#xA0;\r\n\r\n<button style=\"margin-bottom:20px\" type=\"button\" class=\"btn btn-default\" id=\"right\" data-toggle=\"tooltip\" data-placement=\"right\" title=\"Tooltip on right\">Tooltip on right</button>&#xA0; \r\n<br>\r\n\r\n<div id=\"accordion1\" class=\"accordion\">\r\n<div class=\"accordion-group\">\r\n<div class=\"accordion-heading\"><a class=\"accordion-toggle\" href=\"#collapse22\" data-toggle=\"collapse\" data-parent=\"#accordion22\">How to use</a></div>\r\n<div id=\"collapse22\" class=\"accordion-body collapse\">\r\n<div class=\"accordion-inner\">\r\n\r\n<pre>\r\n<code>\r\n&lt;button type=\"button\" class=\"btn btn-default\" id=\"left\" data-toggle=\"tooltip\" data-placement=\"left\" title=\"Tooltip on left\"&gt;Tooltip on left&lt;/button&gt;\r\n&lt;script type=\'text/javascript\'&gt;\r\n jQuery(document).ready(function(){\r\n   jQuery(\"#left\").tooltip({ placement : \'left\'});\r\n  });\r\n&lt;/script&gt;\r\n</code>\r\n</pre>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n\r\n\r\n<br><br>\r\n\r\n\r\n<h3>Popover</h3>\r\n\r\n<script type=\'text/javascript\'>\r\njQuery(document).ready(function(){\r\n    jQuery(\"div#top\").popover({\r\n        placement : \'top\'\r\n    });\r\n\r\n    jQuery(\"div#bottom\").popover({\r\n        placement : \'bottom\'\r\n    });\r\n\r\n    jQuery(\"div#left\").popover({\r\n        placement : \'left\'\r\n    });\r\n\r\n    jQuery(\"div#right\").popover({\r\n        placement : \'right\'\r\n    });\r\n});\r\n</script>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-lg-3\" style=\"margin-bottom:20px\">\r\n  <div id=\"top\" class=\"btn btn-md btn-danger\" \r\n  data-toggle=\"popover\" title=\"Popover Demo\" \r\n  data-content=\"The size of the pop over depends upon the text area\"\r\n  role=\"button\">Click to toggle popover top</div>\r\n</div>\r\n<div class=\"col-lg-3\" style=\"margin-bottom:20px\">\r\n  <div id=\"left\" class=\"btn btn-md btn-danger\" \r\n  data-toggle=\"popover\" title=\"Popover Demo\" \r\n  data-content=\"The size of the pop over depends upon the text area\"\r\n  role=\"button\">Click to toggle popover left</div>\r\n</div>\r\n<div class=\"col-lg-3\" style=\"margin-bottom:20px\">\r\n  <div id=\"bottom\" class=\"btn btn-md btn-danger\" \r\n  data-toggle=\"popover\" title=\"Popover Demo\" \r\n  data-content=\"The size of the pop over depends upon the text area\"\r\n  role=\"button\">Click to toggle popover bottom</div>\r\n</div>\r\n<div class=\"col-lg-3\" style=\"margin-bottom:20px\">\r\n  <div id=\"right\" class=\"btn btn-md btn-danger\" \r\n  data-toggle=\"popover\" title=\"Popover Demo\" \r\n  data-content=\"The size of the pop over depends upon the text area\"\r\n  role=\"button\">Click to toggle popover right</div>\r\n</div>\r\n</div>\r\n<div id=\"accordion20\" class=\"accordion\">\r\n<div class=\"accordion-group\">\r\n<div class=\"accordion-heading\"><a class=\"accordion-toggle\" href=\"#collapse20\" data-toggle=\"collapse\" data-parent=\"#accor