INSERT INTO `vina_content` VALUES ('31', '0', 'Liên hệ với FRP Việt Nam', 'lien-he', '<p>[forms ID=1]</p>', '', '1', '10', '2016-09-26 08:15:24', '992', '', '2017-08-27 09:39:57', '992', '0', '0000-00-00 00:00:00', '2016-09-26 08:15:24', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '5', '1', '', '', '1', '47', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', '');
INSERT INTO `vina_content` VALUES ('32', '0', 'Công ty Cổ phần Thương mại và Sản xuất FRP Việt Nam', 'gioi-thieu', '<h4 style=\"text-transform: uppercase;\">Công ty Cổ phần Thương mại và Sản xuất FRP Việt Nam</h4>\r\n<p><img src=\"images/about_us.jpg\" alt=\"\" /></p>\r\n', '\r\n<h5>Công ty Cổ phần Thương mại và Sản xuất FRP Việt Nam xin gửi đến Quý khách hàng lời chào trân trọng, lời chúc thành công.</h5>\r\n<p>Vina FRP JSC tự hào là một trong những nhà cung cấp sản phẩm FRP hàng đầu tại Việt Nam, được thành lập bởi các chuyên gia, kỹ sư đầu ngành có nhiều năm kinh nghiệm trong lĩnh vực composite Cốt sợi thủy tinh (FRP), cơ khí, thủy lợi, môi trường cùng với các chuyên viên kinh tế năng động, nhiệt tình và sáng tạo.</p>\r\n<p>Thông điệp của Công ty Cổ phần Thương mại và Sản xuất FRP Việt Nam muốn gửi gắm đến Quý vị là: Đến với chúng tôi, Quý vị sẽ được bảo đảm sử dụng sản phẩm Composite cốt sợi thủy tinh (FRP) chất lượng , giá cả cạnh tranh, dịch vụ bán hàng, hậu mãi chuyên nghiệp nhất.</p>\r\n<p>Để đáp ứng yêu của khách hàng, cũng như để khẳng định vai trò và vị thế của Vina FRP JSC, chúng tôi cam kết:</p>\r\n<ol>\r\n<li>Cung cấp các sản phẩm FRP với chất lượng ổn định nhất bằng việc kiểm soát chặt chẽ nguyên vật liệu đầu vào, quá trình sản xuất và nghiệm thu sản phẩm.</li>\r\n<li>Tiến độ cung cấp và thi công nhanh nhất đáp ứng yêu cầu của khách hàng.</li>\r\n<li>Hợp tác, hỗ trợ tối đa khách hàng bằng các dịch vụ, tư vấn kỹ thuật với chất lượng cao, trung thực, tận tâm với khách hàng.</li>\r\n<li>Dịch vụ hậu mãi sau bán hàng như bào hành, hỗ trợ thiết kế, hỗ trợ lắp đặt … luôn là một phần quan trọng trong chính sách kinh doanh của chúng tôi. \"Vina FRP JSC - uy tín - chất lượng ổn định - giá cả hợp lý - dịch vụ chu đáo\".</li>\r\n</ol>', '1', '10', '2016-09-26 09:38:16', '992', '', '2017-09-08 04:08:29', '992', '0', '0000-00-00 00:00:00', '2016-09-26 09:38:16', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', '6', '2', '', '', '1', '88', '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', '0', '*', '');
